package santeclair.lunar.framework.personnalisation;

import org.apache.commons.codec.binary.Base64;
import org.springframework.core.io.ByteArrayResource;

import santeclair.lunar.framework.personnalisation.bean.CharteBean;
import santeclair.lunar.framework.personnalisation.client.PersonnalisationWebserviceClient;
import santeclair.lunar.framework.personnalisation.impl.PersonnalisationManagerBaseImpl;
import santeclair.lunar.framework.util.Base64DataUrlTools;

public class PersonnalisationManagerBaseMock extends PersonnalisationManagerBaseImpl {

    public PersonnalisationManagerBaseMock(PersonnalisationWebserviceClient personnalisationWebserviceClient) {
        super(personnalisationWebserviceClient);
    }

    public PersonnalisationManagerBaseMock() {
        super(null);
    }

    /**
     * {@inheritDoc}
     */
    public ByteArrayResource getInputStreamCodeValue(String code, String idCharte) {
        String data = "data:image/png;base64,";
        data = Base64DataUrlTools.getBase64FileFromDataUrl(data);
        byte[] imageByte = Base64.decodeBase64(data);
        ByteArrayResource in = new ByteArrayResource(imageByte);
        return in;
    }

    /**
     * {@inheritDoc}
     */
    public String getMimeType(String code, String idCharte) {
        String data = "data:image/png;base64,";
        return Base64DataUrlTools.getMimeTypeFromDataUrl(data);
    }

    public String getCodeValue(String code, String idCharte) {
        return "SANTECLAIR";
    }

    public String getCodeValue(String code) {
        return "SANTECLAIR";
    }

    @Override
    public CharteBean getCharteCourrier(String codeOrganisme) {
        CharteBean charte = new CharteBean();
        charte.setCode("SANTECLAIR");
        return charte;
    }
}
